script: |
  super -f text -I q3592.spq | sort > q3592.out

inputs:
  - name: q3592.spq
    data: |
      SELECT + col2 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT col1 IN ( col2, CAST ( - - 21 AS INTEGER ) - - col0, - col1, + 53, + col0 * - col1 * + + col1, - + col1 );
  - name: tab0

outputs:
  - name: q3592.out
    data: |
      10
      47
      99
